import React, { Fragment } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function Card({ text }) {
  return (
    <div
      style={{
        color: "black",
        background: "lightgrey",
        padding: "15px 10px",
        display: "inline-flex",
        textAlign: "left",
        alignItems: "center",
        justifyContent: "left",
        borderRadius: "10px",
        transform: "translate(-50%, -50%)",
      }}
    >
      <p>{text}</p>
    </div>
  );
}

export default Card;
